settings.tooltipFunction:
var floorNumber = dsData[dsIndex]['Level'];

var tooltip = '<b>${friendlyName}</b><br/>${entityName}<br/>';
var typeTooltip = '';


if (floorNumber == 1) {

    typeTooltip = '<br/><link-act name="floor_1">Go to floor 1</link-act><br/></div>';
} else if (floorNumber == 2) {
    typeTooltip += '<br/><link-act name="floor_2">Go to floor 2</link-act><br/></div>';
} 



return tooltip + typeTooltip;

settings.colorFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'thermometer') {
	var res = {
	    url: images[0],
	    size: 40
	}
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120;
	    var index = Math.min(3, Math.floor(4 * percent));
	    res.url = images[index];
	}
	return res;
}

